    fechaFin: "2023-10-20T00:00:00Z",
    horaInicio: "2023-10-20T00:00:00Z",
    horaFin: "2023-10-20T00:00:00Z",
    sala: 1,
    precio: 1000,
}

function App() {
    return (
        <div className="App">
